import React from 'react';
import { Link } from 'react-router-dom';
import './Signup.css';

function Signup() {
  return (
    <div className="signup-container">
      <div className="signup-logo">StreamFlix</div>
      <h1 className="signup-title">Sign Up</h1>
      <input className="signup-input" type="email" placeholder="Email address" />
      <input className="signup-input" type="password" placeholder="Password" />
      <button className="signup-btn">Sign Up</button>
      <div className="signup-footer">
        Already have an account? <Link to="/signin">Sign in now.</Link>
      </div>
    </div>
  );
}

export default Signup;
